CREATE PROCEDURE dbo.proc_transform_193
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_193
    SET payload = LEFT(payload, 1000) + N'|V4-193|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_193;
END
